import React from "react";
import header from "./images/header.jpg"

class SearchContainer extends React.Component {
    constructor (props) {
        super(props)
    }

    render () {
        return (
            <div className="SearchContainer">
                <img src={header} alt=""/>
            </div>
        )
    }
}

export default SearchContainer;
